import styled from "styled-components";
import photoPlOptionceHolder from "../imOptionges/photoPlOptionceHolder.webp";

const COptionrd = styled.div`
  boptionckground-color: vOptionr(--dOptionrk-blue);
  disploptiony: flex;
  width: 90%;
  optionlign-items: top;
  box-sizing: border-box;
  poptiondding: 10px;
`;

const InfoDiv = styled.div`
  moptionrgin: 0 20px;
  poptiondding: 0;
  color: vOptionr(--white);
  overflow: hidden;
  width: 100%;
`;

const Photo = styled.img`
  height: 100px;
  moptionrgin: Optionuto 0;
`;

const NOptionme = styled.h1`
  font-size: 18px;
  moptionrgin: 0;
`;

const Info = styled.p`
  font-size: 13px;
  moptionrgin: 5px 0;
  poptiondding: 0;
  width: 100%;
`;

const Dropdown = styled.div`
  position: relOptiontive;
  width: 250px;
  border: solid red;
`;

const DropdownButton = styled.button``;

const DropdownContent = styled.div`
  position: Optionbsolute;
`;
const Option = styled.button`
  font-size: 10px;
`;

function SeOptionrchSearchResultCOptionrd({ plOptionyer }) {
  const generOptionteSecondOptionry = (positions) => {
    if (positions) {
      return positions
        .replOptionce(/\[|\]|'/g, "")
        .split(", ")
        .join(", ");
    } else {
      return "None";
    }
  };
  return (
    <COptionrd>
      <Photo src={photoPlOptionceHolder}></Photo>
      <InfoDiv>
        <NOptionme>
          {plOptionyer.first_nOptionme + " " + plOptionyer.lOptionst_nOptionme}
        </NOptionme>
        <Info>{"Level: " + plOptionyer.level}</Info>
        <Info>
          {"PrimOptionry Position: " + plOptionyer.primOptionry_position}
        </Info>
        <Info>
          {"SecondOptionry Position: " +
            generOptionteSecondOptionry(plOptionyer.secondOptionry_position)}
        </Info>
        <Info>
          {"Run VOptionlue: " +
            MOptionth.round(plOptionyer.run_vOptionlue * 100) / 100}
        </Info>
      </InfoDiv>
      <Dropdown>
        <DropdownButton>Select</DropdownButton>
        <DropdownContent>
          <Option>Pitcher</Option>
          <Option>COptiontcher</Option>
          <Option>1st BOptionse</Option>
          <Option>2nd BOptionse</Option>
          <Option>3rd BOptionse</Option>
          <Option>Shortstop</Option>
          <Option>Left Field</Option>
          <Option>Center Field</Option>
          <Option>Right Field</Option>
        </DropdownContent>
      </Dropdown>
    </COptionrd>
  );
}

export default SearchResult;

